import React, { useState } from "react";

const Navbar = () => {
  const [darkMode, setDarkMode] = useState(false);

  const toggleDarkMode = () => {
    setDarkMode(!darkMode);
    document.documentElement.classList.toggle("dark");
  };

  const showHelp = () => {
    alert("Need help? Contact support@example.com");
  };

  return (
    <nav className="flex justify-between items-center bg-gray-100 dark:bg-gray-800 text-gray-800 dark:text-white p-4 shadow-md">
      <div className="font-bold text-lg">App Name</div>
      <div className="flex space-x-4">
        {/* Dark Mode Toggle */}
        <button
          onClick={toggleDarkMode}
          className="px-4 py-2 rounded bg-gray-200 dark:bg-gray-700"
        >
          {darkMode ? "Light Mode" : "Dark Mode"}
        </button>

        {/* Help Button */}
        <button
          onClick={showHelp}
          className="px-4 py-2 rounded bg-blue-500 text-white"
        >
          Help
        </button>
      </div>
    </nav>
  );
};

export default Navbar;
